module Heatmap =
    [<Tests>]
    let ``Heatmap chart HTML codegeneration tests`` =
        testList "JSONGen.Chart2D" [
            testList "Heatmap" [
                testCase "Heatmap toJson" ( fun () ->
                    """{"data":[{"type":"heatmap","x":["Tp0","Tp30","Tp60","Tp160"],"y":["p3","p2","p1"],"z":[[1.0,1.5,0.7,2.7],[2.0,0.5,1.2,1.4],[0.1,2.6,2.4,3.0]],"colorscale":[[0.0,"#3D9970"],[1.0,"#001f3f"]],"showscale":true}],"layout":{"width":700,"height":500,"margin":{"l":200.0}},"config":{}}"""
                    |> jsonIs Heatmap.``simple heatmap with custom colorscale``
                )
                testCase "Heatmap toFigureJson" ( fun () ->
                    """{"data":[{"type":"heatmap","x":["Tp0","Tp30","Tp60","Tp160"],"y":["p3","p2","p1"],"z":[[1.0,1.5,0.7,2.7],[2.0,0.5,1.2,1.4],[0.1,2.6,2.4,3.0]],"colorscale":[[0.0,"#3D9970"],[1.0,"#001f3f"]],"showscale":true}],"layout":{"width":700,"height":500,"margin":{"l":200.0}},"frames":[]}"""
                    |> figureJsonIs Heatmap.``simple heatmap with custom colorscale``
                );
                testCase "Heatmap styled toJson" ( fun () ->
                    """{"data":[{"type":"heatmap","x":["Tp0","Tp30","Tp60","Tp160"],"y":["p3","p2","p1"],"z":[[1.0,1.5,0.7,2.7],[2.0,0.5,1.2,1.4],[0.1,2.6,2.4,3.0]],"colorscale":[[0.0,"#3D9970"],[1.0,"#001f3f"]],"showscale":true,"colorbar":{"title":{"text":"Im the Colorbar"}}}],"layout":{"width":700,"height":500,"margin":{"l":200.0}},"config":{}}"""
                    |> jsonIs Heatmap.``Simple heatmap with custom colorscale and styled colorbar``
                )
                testCase "Heatmap styled toFigureJson" ( fun () ->
                    """{"data":[{"type":"heatmap","x":["Tp0","Tp30","Tp60","Tp160"],"y":["p3","p2","p1"],"z":[[1.0,1.5,0.7,2.7],[2.0,0.5,1.2,1.4],[0.1,2.6,2.4,3.0]],"colorscale":[[0.0,"#3D9970"],[1.0,"#001f3f"]],"showscale":true,"colorbar":{"title":{"text":"Im the Colorbar"}}}],"layout":{"width":700,"height":500,"margin":{"l":200.0}},"frames":[]}"""
                    |> figureJsonIs Heatmap.``Simple heatmap with custom colorscale and styled colorbar``
                );
            ]
        ]

