module Image =
    [<Tests>]
    let ``Image chart HTML codegeneration tests`` =
        testList "JSONGen.Chart2D" [
            testList "Image" [
                testCase "Image raw toJson" ( fun () ->
                    """{"data":[{"type":"image","z":[[[0,0,255],[255,255,0],[0,0,255]],[[255,0,0],[255,0,255],[255,0,255]],[[0,255,0],[0,255,255],[255,0,0]]]}],"layout":{"title":{"text":"Image chart from raw color component arrays"}},"config":{}}"""
                   |> jsonIs Image.``Raw color component image chart``
                )
                testCase "Image raw toFigureJson" ( fun () ->
                    """{"data":[{"type":"image","z":[[[0,0,255],[255,255,0],[0,0,255]],[[255,0,0],[255,0,255],[255,0,255]],[[0,255,0],[0,255,255],[255,0,0]]]}],"layout":{"title":{"text":"Image chart from raw color component arrays"}},"frames":[]}"""
                    |> figureJsonIs Image.``Raw color component image chart``
                );        
                testCase "Image raw hsl toJson" ( fun () ->
                    """{"data":[{"type":"image","z":[[[0,0,255],[255,255,0],[0,0,255]],[[255,0,0],[255,0,255],[255,0,255]],[[0,255,0],[0,255,255],[255,0,0]]],"colormodel":"hsl"}],"layout":{"title":{"text":"HSL color model"}},"config":{}}"""
                   |> jsonIs Image.``HSL image chart``
                )
                testCase "Image raw hsl toFigureJson" ( fun () ->
                    """{"data":[{"type":"image","z":[[[0,0,255],[255,255,0],[0,0,255]],[[255,0,0],[255,0,255],[255,0,255]],[[0,255,0],[0,255,255],[255,0,0]]],"colormodel":"hsl"}],"layout":{"title":{"text":"HSL color model"}},"frames":[]}"""
                    |> figureJsonIs Image.``HSL image chart``
                );        
                testCase "Image ARGB toJson" ( fun () ->
                    """{"data":[{"type":"image","z":[[[240,248,255,255],[255,248,220,255],[255,240,245,255]],[[169,169,169,255],[255,250,250,255],[25,25,112,255]],[[176,196,222,255],[189,183,107,255],[135,206,250,255]]],"colormodel":"rgba"}],"layout":{"title":{"text":"ARGB image chart"}},"config":{}}"""
                   |> jsonIs Image.``ARGB image chart``
                )
                testCase "Image ARGB toFigureJson" ( fun () ->
                    """{"data":[{"type":"image","z":[[[240,248,255,255],[255,248,220,255],[255,240,245,255]],[[169,169,169,255],[255,250,250,255],[25,25,112,255]],[[176,196,222,255],[189,183,107,255],[135,206,250,255]]],"colormodel":"rgba"}],"layout":{"title":{"text":"ARGB image chart"}},"frames":[]}"""
                    |> figureJsonIs Image.``ARGB image chart``
                );        

                testCase "Image base64 toJson" ( fun () ->
                    """{"data":[{"type":"image","source":"data:image/jpg;base64,"}],"layout":{"title":{"text":"This is Plotly.NET:"}},"config":{}}"""
                    |> jsonIs Image.``Image chart from base64 string``
