                testCase "Image base64 toFigureJson" ( fun () ->
                    """{"data":[{"type":"image","source":"data:image/jpg;base64,"}],"layout":{"title":{"text":"This is Plotly.NET:"}},"frames":[]}"""
                    |> figureJsonIs Image.``Image chart from base64 string``
                );        
            ]
        ]

